  return (
    <div>
        <nav>
      <Link to="/">Home</Link>
    
      <Link to="/">score</Link>
     
      <Link to="/user/ranking">ranking</Link>
      <Link to="/user/contractus">contract us</Link>
      <Link to="/user/login">Login</Link>

      <Dropdown>
  <Dropdown.Toggle>
 
  </Dropdown.Toggle>


</Dropdown>
      </nav>
    </div>
  );
}
